import React from "react";
import {Link} from 'react-router-dom';


function Recipe({ recipe }) {
  const { title, year, description, adress,  phone, image, _id } = recipe;
  return (
    <summary>
      <div class= "box" >
       <div class= "one-item">
       {/* <img class="jjj" src={`img/${image}`} alt={title} /> */}

       </div>

      <div class="two-item">
        <h2>
        <Link to={_id}>{title}</Link>
        </h2>
      </div>

      <div class="three-item">
        <p>{description}</p>
      </div>

      <div class= "four-item">
      <h3>Adress</h3>
      <p>{adress}</p>
      </div>

      <div class="five-item">
      <h3>Phone</h3><p>{phone}</p>
      </div>

      <div class= "six-item">
      <small>Published: {year}</small>
      </div>

      </div>

    </summary>
  );
}

export default Recipe;
